import React from "react";
import styled from "styled-components";
import { Container } from "../../components/layout/Container";
import { FullImage } from "../../components/UI/FullImage";

import frankImage from "../../assets/images/frank.jpg";
import Body from "../../components/layout/Body";
const frank = () => {
  return (
    <Container space>
      <FullImage imageSrc={frankImage} />

      <Body>
        <Subtitle>Who is Frank?</Subtitle>
        <p>
          What differentiates Frank from our competitors is how we run the
          business, day in day out. Family owned and operated, we take pride in
          the fact that we have many long-standing members of the Frank team.{" "}
        </p>
      </Body>
    </Container>
  );
};

const Subtitle = styled.h4`
  display: grid;
`;

const Text = styled.div`
  display: grid;
  padding: 0 ${({ theme }) => theme.paddingW};
`;

export default frank;
